pfxm_length (PrefixMatch x1 x2) = x2;

prefix_match_less_eq1 ::
  forall a. (Len a) => Prefix_match a -> Prefix_match a -> Bool;
prefix_match_less_eq1 a b =
  (if equal_nat (pfxm_length a) (pfxm_length b)
    then less_eq_word (pfxm_prefix a) (pfxm_prefix b)
    else less_nat (pfxm_length b) (pfxm_length a));

less_eq_prefix_match ::
  forall a. (Len a) => Prefix_match a -> Prefix_match a -> Bool;
less_eq_prefix_match a b = prefix_match_less_eq1 a b;

