         IngressPort ab ->
           (case ba of {
             IngressPort bb -> ab <= bb;
             EtherSrc word ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (EtherSrc word));
             EtherDst word ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (EtherDst word));
             EtherType word ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (EtherType word));
             VlanId word ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (VlanId word));
             VlanPriority word ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (VlanPriority word));
             IPv4Src prefix_match ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (IPv4Src prefix_match));
             IPv4Dst prefix_match ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (IPv4Dst prefix_match));
             IPv4Proto word ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (IPv4Proto word));
             L4Src word1 word2 ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (L4Src word1 word2));
             L4Dst word1 word2 ->
               less_nat (match_sorter (IngressPort ab))
                 (match_sorter (L4Dst word1 word2));
           });
         EtherSrc ab ->
           (case ba of {
             IngressPort list ->
               less_nat (match_sorter (EtherSrc ab))
                 (match_sorter (IngressPort list));
             EtherSrc bb -> less_eq_word ab bb;
             EtherDst wordb ->
               less_nat (match_sorter (EtherSrc ab))
