newtype Iface = Iface [Prelude.Char];

data Simple_match_ext a =
  Simple_match_ext Iface Iface
    (Word (Bit0 (Bit0 (Bit0 (Bit0 (Bit0 Num1))))), Nat)
    (Word (Bit0 (Bit0 (Bit0 (Bit0 (Bit0 Num1))))), Nat) Protocol
    (Word (Bit0 (Bit0 (Bit0 (Bit0 Num1)))),
      Word (Bit0 (Bit0 (Bit0 (Bit0 Num1)))))
    (Word (Bit0 (Bit0 (Bit0 (Bit0 Num1)))),
      Word (Bit0 (Bit0 (Bit0 (Bit0 Num1)))))
    a;

equal_iface :: Iface -> Iface -> Bool;
equal_iface (Iface x) (Iface ya) = x == ya;

equal_simple_match_ext ::
  forall a. (Eq a) => Simple_match_ext a -> Simple_match_ext a -> Bool;
equal_simple_match_ext
  (Simple_match_ext iifacea oifacea srca dsta protoa sportsa dportsa morea)
  (Simple_match_ext iiface oiface src dst proto sports dports more) =
  equal_iface iifacea iiface &&
    equal_iface oifacea oiface &&
      srca == src &&
        dsta == dst &&
          equal_protocol protoa proto &&
            sportsa == sports && dportsa == dports && morea == more;

data Simple_action = Accepta | Dropa;

equal_simple_action :: Simple_action -> Simple_action -> Bool;
equal_simple_action Accepta Dropa = False;
equal_simple_action Dropa Accepta = False;
equal_simple_action Dropa Dropa = True;
equal_simple_action Accepta Accepta = True;

data Simple_rule = SimpleRule (Simple_match_ext ()) Simple_action;

equal_simple_rule :: Simple_rule -> Simple_rule -> Bool;
equal_simple_rule (SimpleRule x1 x2) (SimpleRule y1 y2) =
  equal_simple_match_ext x1 y1 && equal_simple_action x2 y2;

instance Eq Simple_rule where {
  a == b = equal_simple_rule a b;
};

