bin_rest :: Int -> Int;
bin_rest w = divide_int w (Int_of_integer (2 :: Integer));

shiftr1 :: forall a. (Len0 a) => Word a -> Word a;
shiftr1 w = word_of_int (bin_rest (uint w));

