bitNOT_word a = word_of_int (bitNOT_int (uint a));

internal_iface_name_match :: [Prelude.Char] -> [Prelude.Char] -> Bool;
internal_iface_name_match [] [] = True;
internal_iface_name_match (i : is) [] = i == '+' && null is;
internal_iface_name_match [] (uu : uv) = False;
internal_iface_name_match (i : is) (p_i : p_is) =
  (if i == '+' && null is then True
    else p_i == i && internal_iface_name_match is p_is);

match_iface :: Iface -> [Prelude.Char] -> Bool;
match_iface (Iface i) p_iface = internal_iface_name_match i p_iface;

ifaceAny :: Iface;
ifaceAny = Iface ['+'];

simple_match_to_of_match ::
  Simple_match_ext () -> [[Prelude.Char]] -> [Set Of_match_field];
simple_match_to_of_match m ifs =
  let {
    npm = (\ p -> equal_word (fst p) zero_word && equal_word (snd p) max_word);
    sb = (\ p ->
           (if npm p then [Nothing]
             else (if less_eq_word (fst p) (snd p)
                    then map (Just .
                               (\ pfx ->
                                 (pfxm_prefix pfx,
                                   bitNOT_word (pfxm_mask pfx))))
                           (wordinterval_CIDR_split_internal
                             (WordInterval (fst p) (snd p)))
                    else [])));
  } in concatMap
         (\ iif ->
           concatMap
             (\ sport ->
               map (simple_match_to_of_match_single m iif (proto m) sport)
                 (sb (dports m)))
             (sb (sports m)))
         (if equal_iface (iiface m) ifaceAny then [Nothing]
           else concatMap
                  (\ i -> (if match_iface (iiface m) i then [Just i] else []))
                  ifs);

lr_of_tran_s3 ::
  forall a.
    [[Prelude.Char]] ->
      [(a, (Simple_match_ext (), ([Prelude.Char], Simple_action)))] ->
        [(a, (Set Of_match_field, [Of_action]))];
lr_of_tran_s3 ifs ard =
  concatMap
    (\ (p, a) ->
      let {
        (r, aa) = a;
        (c, ab) = aa;
      } in map (\ b -> (p, (b, (case ab of {
                                 Accepta -> [Forward c];
                                 Dropa -> [];
                               }))))
             (simple_match_to_of_match r ifs))
    ard;

split3 :: forall a b c d. (a -> b -> c -> d) -> (a, (b, c)) -> d;
split3 f p = let {
               (a, b) = p;
               (ba, c) = b;
             } in f a ba c;

pack_OF_entries ::
  [[Prelude.Char]] ->
