       (Simple_match_ext (), ([Prelude.Char], Simple_action)))] ->
      [Flow_entry_match Of_match_field [Of_action]];
pack_OF_entries ifs ard =
  fun_app (map (split3 OFEntry)) (lr_of_tran_s3 ifs ard);

