list_toString :: forall a. (a -> [Prelude.Char]) -> [a] -> [Prelude.Char];
list_toString toStr ls =
  ['['] ++ list_separated_toString [',', ' '] toStr ls ++ [']'];

ipt_tcp_flags_toString :: Set Tcp_flag -> [Prelude.Char];
ipt_tcp_flags_toString flags =
