ctstate_assume_state s (Match (Src v)) = Match (Src v);
ctstate_assume_state s (Match (Dst v)) = Match (Dst v);
ctstate_assume_state s (Match (IIface v)) = Match (IIface v);
ctstate_assume_state s (Match (OIface v)) = Match (OIface v);
