  (case (common_primitive_match_to_simple_match m1,
          common_primitive_match_to_simple_match m2)
    of {
    (Nothing, _) -> Nothing;
    (Just _, Nothing) -> Nothing;
    (Just a, Just b) -> simple_match_and a b;
