unfolded :: [Rule Common_primitive];
unfolded =
  unfold_ruleset_FORWARD sQRL_fw_FORWARD_default_policy (map_of_string sQRL_fw);

sQRL_fw_simple :: [Simple_rule];
sQRL_fw_simple =
  remdups_rev_code []
    (to_simple_firewall
      (upper_closure
        (optimize_matches abstract_for_simple_firewall
          (upper_closure (packet_assume_new unfolded)))));

swap :: forall a b. (a, b) -> (b, a);
swap p = (snd p, fst p);

sQRL_ifs :: [[Prelude.Char]];
sQRL_ifs = map (output_iface . routing_action) sQRL_rtbl_main;

sQRL_ports :: [([Prelude.Char], [Prelude.Char])];
sQRL_ports =
  fun_app (map (apsnd string_of_nat . swap)) (annotate_rlen sQRL_ifs);

ofi :: Nat -> [[Prelude.Char]];
ofi n =
  fun_app (map (serialize_of_entry (the . map_of sQRL_ports)) . theRight)
    (lr_of_tran sQRL_rtbl_main_sorted (take n sQRL_fw_simple) sQRL_ifs);

